import "./App.css";
import { Component } from "react";

class App extends Component {
  state = {
    posts: [
      {
        id: 1,
        title: "O titulo 1",
        body: "Corpo do post 1",
      },
      {
        id: 2,
        title: "O titulo 2",
        body: "Corpo do post 2",
      },
      {
        id: 3,
        title: "O titulo 3",
        body: "Corpo do post 3",
      },
    ],
  };

  render() {
    const { posts } = this.state;
    return (
      <div className="App">
        {posts.map((post) => (
          <h1 key={post.id}>{post.title}</h1>
        ))}
      </div>
    );
  }
}

export default App;
